const PreviewPage = (props) => {
  const { userName, userAddr, userTel, userComment } = props;
  return (
    <div className="PreviewPage">
      <ul className="dataListForm">
        <li name="userName">{userName}</li>
        <li name="userAddr">{userAddr}</li>
        <li name="userTel">{userTel}</li>
        <li name="userComment">{userComment}</li>
      </ul>
    </div>
  );
};
export default PreviewPage;
